import React, { FC } from 'react'
import { useNavigate } from 'react-router-dom'
import Contacts from '../contacts/Contacts'
import './Top.scss'

interface TopProps {
}

const Top: FC<TopProps> = React.forwardRef(({ }, ref) => {

	const navigate = useNavigate()

	return (
		<section className='top' ref={ref}>
			<div className='top__logo' onClick={() => { navigate('/mainpage') }}>
				<img src="https://dthomefix.wpenginepowered.com/wp-content/themes/homefix/images/logo.png" alt="logo" />
			</div>
			<Contacts />
		</section>
	)
})

export default Top
